    static void Main()
    {
        Console.Write("From row (0-99): ");
        int startRow = int.Parse(Console.ReadLine());
        Console.Write("From column (0-99): ");
        int startCol = int.Parse(Console.ReadLine());

        Console.Write("To row (0-99): ");
        int endRow = int.Parse(Console.ReadLine());
        Console.Write("To column (0-99): ");
        int endCol = int.Parse(Console.ReadLine());

        if (matrix[endRow, endCol] == '*')
        {
            exists = false;
            Console.WriteLine("Please place the end-cell on empty space!");
            return;
        }
        matrix[endRow, endCol] = 'e';

        FindPath(startRow, startCol);

        if (exists)
        {
            Console.WriteLine("YES!");
        }
        else
        {
            Console.WriteLine("NO!");
        }
    }

    private static void FindPath(int row, int col)
    {
        if (!exists)
        {
            if (row < 0 || col < 0 || row > matrix.GetLength(0) - 1 || col > matrix.GetLength(1) - 1)
            {
                return;
            }

            if (matrix[row, col] == 'e')
            {
                exists = true;
                return;
            }

            if (matrix[row, col] != ' ')
            {
                return;
            }

            matrix[row, col] = 'V';

            FindPath(row + 1, col);
            FindPath(row, col - 1);
            FindPath(row - 1, col);
            FindPath(row, col + 1);

            matrix[row, col] = ' ';
        }
        
    }
